import React from 'react';
import { Container, CssBaseline, ThemeProvider, createTheme } from '@mui/material';
import { motion } from 'framer-motion';
import Navbar from './components/NavBar/navbar';
import Intro from './components/Intro/intro';
import Skills from './components/Skills/skills';
import Works from './components/Works/works';
import Projects from './components/Projects/projects';
import Contact from './components/Contact/contact';
import Footer from './components/footer/footer';
import Logos from './components/Logos/logos';
//import Testimonials from './components/Testimonials/testimonials'; // Example new component

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div className="App">
        <Navbar />
        <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }}>
          <Intro />
        </motion.div>
        <motion.div initial={{ x: '-100vw' }} animate={{ x: 0 }} transition={{ duration: 1 }}>
          <Skills />
        </motion.div>
        <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }}>
          <Logos />
        </motion.div>
        <motion.div initial={{ x: '100vw' }} animate={{ x: 0 }} transition={{ duration: 1 }}>
          <Works />
        </motion.div>
        <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }}>
          <Projects />
        </motion.div>
        <motion.div initial={{ y: '100vh' }} animate={{ y: 0 }} transition={{ duration: 1 }}>
          <Contact />
        </motion.div>
        <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }}>
        </motion.div>
        <Footer />
      </div>
    </ThemeProvider>
  );
}

export default App;
